import React from "react";

function Tabs({ title }) {
  return <div className="tabs hover1">{title}</div>;
}
export default function HomeLeft() {
  return (
    <div className="home_left">
      <Tabs title="Feed" active="active" />
      <Tabs title="Chat" />
    </div>
  );
}
